-- ALTER SEQUENCE student_stu_id_seq RESTART WITH 1001
create table student (
	stu_id serial PRIMARY KEY,
	f_name VARCHAR(50),
	l_name VARCHAR(50),
	username VARCHAR(50) UNIQUE
);

-- ALTER SEQUENCE class_c_id_seq RESTART WITH 1001
create table class (
	c_id serial PRIMARY KEY,
	name VARCHAR(50),
	term VARCHAR(6),
	year VARCHAR(50),
	description VARCHAR(255)
);

-- ALTER SEQUENCE section_sec_id_seq RESTART WITH 1001
create table section (
	sec_id serial PRIMARY KEY,
	number INTEGER NOT NULL,
	c_id INTEGER NOT NULL REFERENCES class
);

-- ALTER SEQUENCE enrolled_e_id_seq RESTART WITH 1001
create table enrolled (
	e_id serial PRIMARY KEY,
	stu_id INTEGER NOT NULL REFERENCES student,
	sec_id INTEGER NOT NULL REFERENCES section
);

-- ALTER SEQUENCE type_t_id_seq RESTART WITH 1001
create table type (
	t_id serial PRIMARY KEY,
	type VARCHAR(12),
	weight DECIMAL(2,1),
	sec_id INTEGER NOT NULL REFERENCES section
);


-- ALTER SEQUENCE assignment_a_id_seq RESTART WITH 1001
create table assignment (
	a_id serial PRIMARY KEY,
	description VARCHAR(255),
	title VARCHAR(50),
	tot_points INTEGER NOT NULL,
	rec_points INTEGER,
	stu_id INTEGER NOT NULL REFERENCES student,
	t_id INTEGER NOT NULL REFERENCES type
);












ALTER SEQUENCE student_stu_id_seq RESTART WITH 1001;
ALTER SEQUENCE class_c_id_seq RESTART WITH 1001;
ALTER SEQUENCE section_sec_id_seq RESTART WITH 1001;
ALTER SEQUENCE enrolled_e_id_seq RESTART WITH 1001;
ALTER SEQUENCE type_t_id_seq RESTART WITH 1001;
ALTER SEQUENCE assignment_a_id_seq RESTART WITH 1001;